import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
    <nav className="app">
    <li>Home</li>
    <li>About</li>
    <li>Contact Us</li>
    <li>Rating</li>
    </nav>
    </>
  );
}

export default App;
